import React from "react";

import { Route ,Routes } from "react-router-dom";
import Home from "../Pages/Home";
import Login from "../Pages/Login";


function App() {







  return (

   <Routes> 

   <Route path="/Home"  element={<Home/>}                         />
   <Route   path="/"        element={<Login/>}                /> 



  </Routes>
  );
}

export default App;
